import React from "react";
import style from "./NavBar.module.css";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <nav className={style.nav}>
      <ul>
      <NavLink to="/" style={{ textDecoration: "none", color: 'white' }}>
          <li className={style.li}>
            Home
          </li>
        </NavLink>
        <NavLink to="/myServer" style={{ textDecoration: "none", color: 'white' }}>
          <li className={style.li}>
            <a href=".#">My Server</a>{" "}
          </li>
        </NavLink>
        <NavLink to="/recommended" style={{ textDecoration: "none", color: 'white' }}>
          <li>
            <a href=".#"></a>{" "}
          </li>
        </NavLink>
        <NavLink to="/NAserver" style={{ textDecoration: "none", color: 'white' }}>
          <li className={style.li}>
            NA Server
          </li>
        </NavLink>
      </ul>
    </nav>
  );
}

export default NavBar;
